	/**
	 * Handler del evento click en el grafico
	 * Muestra el grafico de detalle sobre la practica seleccionada
	 */
	Indicadores.practicas.clickHandler = function(event){
		var sliceColor = event.color;
		var name = event.name;
		
		var detailData = Indicadores.practicas.util.getDetailData(name);
		
		var options = createOptions('bar',detailData[0],'chart-container-2');
		
	
		options.setTooltipFormatter(function() {
			var cantidadVsPadron = this.point.getData("cantidadVsPadron");
			var afiliadosAtendidos = this.point.getData("afiliadosAtendidos");
			var costoPromedio = this.point.getData("costoPromedio");
			var costoVsPadron = this.point.getData("costoVsPadron");
			var html = '<p><b>Codigo: </b>' + this.x + '</p>'
					+ '<p><b>Descripcion: </b>'+ this.point.description.trim() + "</p>"
					+ '<p><b>'+  Indicadores.util.getTipo()+ ' Practicas: </b>'  +  
					 	Indicadores.util.getSign() + toMoney(this.y)
					+ '</p>'
					+ '<p><b>Cantidad Afiliados Distintos Atendidos</b>: '+ toMoney(afiliadosAtendidos) + '</p>'
					+ '<p><b>Valor promedio</b>: $'+ toMoney(costoPromedio) + '</p>'
					+ '<p><b>Tasa de uso</b>: '+ toMoney(cantidadVsPadron,3) + '</p>'
					+ '<p><b>Tasa de valor</b>: '+ toMoney(costoVsPadron,3) + '</p>';
			return html;
			});
		//Le pongo a las barras el mismo color que la porcion de la torta
		options.series[0].color = sliceColor;
		setxAxisTitle(options,"Codigo");
		setyAxisTitle(options,Indicadores.util.getTipo() + " " + Indicadores.util.getSign());
		//Oculto las leyendas
		options.legend.enabled = false; 
		
		new Highcharts.Chart(options);
	};
	
	
